def findMaximumXOR(nums):
    maXor = 0
    nums = list(set(nums))
    print(nums)
    for i in range(len(nums)):
        for j in range(i,len(nums)):
            xor = nums[i] ^ nums[j]
            if xor > maXor:
                maXor = xor
    print(maXor)
            
    
    
